import ColorPanel from './ColorPanel';
import { defaultPalette } from './constant';
import { ColorPickerProps } from './types';

// \u5C06defaultPalette\u8F6C\u6362\u4E3AColorPreset\u9700\u8981\u7684\u683C\u5F0F
